import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Table from "./Assets/Table"

class App extends Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit </p>
        </header>
        <section>
            {Table}
        </section>
      </div>
    );
  }
}

export default App;
